// ==UserScript==
// @name         999dice extension: fast exchange buttons
// @namespace    https://www.999dice.com/
// @namespace    https://www.999doge.com/
// @version      1.0
// @description  Adds some buttons for faster exchange
// @author       T-Bone
// @match        https://www.999dice.com/
// @include      https://www.999dice.com/
// @match        https://www.999doge.com/
// @include      https://www.999doge.com/
// @grant        none
// ==/UserScript==

//icons
var Base64_btc = "data:image/png;base64,";
var Base64_doge = "data:image/png;base64,";
var Base64_ltc = "data:image/png;base64,";
var Base64_eth = "data:image/png;base64,";

// container element for buttons
$('<div id="QuickExchangeButtonContainer" style="margin-left: 4px; vertical-align: top;"></div>').insertAfter(".WithdrawButton");

// Add BTC -> DOGE, BTC -> LTC ... buttons ( data-currencyid="1" ) 
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="1" data-exchangeusername="Exchange [ BTC -> DOGE ]" data-exchangeid="68156396"><div class="QuickExchangeButton" style="background: url(\''+ Base64_doge +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;"></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="1" data-exchangeusername="Exchange [ BTC -> LTC ]" data-exchangeid="68156410"><div class="QuickExchangeButton" style="background: url(\''+ Base64_ltc +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;"></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="1" data-exchangeusername="Exchange [ BTC -> ETH ]" data-exchangeid="68156415"><div class="QuickExchangeButton" style="background: url(\''+ Base64_eth +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;"></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));

//Add Alt -> BTC buttons
// doge -> btc ( data-currencyid="2" )
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="2" data-exchangeusername="Exchange [ DOGE -> BTC ]" data-exchangeid="68156397"><div class="QuickExchangeButton" style="background: url(\''+ Base64_btc +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;"></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));
// ltc -> btc ( data-currencyid="3" )
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="3" data-exchangeusername="Exchange [ LTC -> BTC ]" data-exchangeid="68156411"><div class="QuickExchangeButton" style="background: url(\''+ Base64_btc +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;" ></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));
// eth -> btc ( data-currencyid="4" )
$('#QuickExchangeButtonContainer').append($('<div class="TextButton" data-currencyid="4" data-exchangeusername="Exchange [ ETH -> BTC ]" data-exchangeid="68156416"><div class="QuickExchangeButton" style="background: url(\''+ Base64_btc +'\'); background-position: center center; background-repeat: no-repeat; width: 32px; height: 20px;"></div></div>').click(function(){ view.controls.openWithdrawBox(parseInt($(this).attr("data-exchangeid")), $(this).attr("data-exchangeusername"));  }));

//just show buttons for selected currency and hide others
function currencyChanged(){
    //currencyId for selected coin
    c = config.displayCurrencyId;
    
    //hide all buttons
    $('#QuickExchangeButtonContainer > div').addClass('Hidden');
    
    //show just buttons for selected coin
    $('#QuickExchangeButtonContainer > div[data-currencyid="'+c+'"]').removeClass('Hidden');
    
}
currencyChanged();

//add click event. call currencyChanged on switch
$('#DisplayCurrencies > span').click(currencyChanged);
